Dictionaries are how UniFFI represents structured data. They consist of one of more named fields , each of which holds a value of a particular type. Think of them like a Rust struct without any methods. A Rust struct like this: struct TodoEntry { done: bool, due_date: u64, text: String,
} Can be exposed via UniFFI using UDL like this: dictionary TodoEntry { boolean done; u64 due_date; string text;
}; The fields in a dictionary can be of almost any type, including objects or other dictionaries. The current limitations are: They cannot recursively contain another instance of the same dictionary type. They cannot contain references to callback interfaces.

