If a dictionary contains a field whose type is an interface , then that field will hold a reference to an underlying instance of a Rust struct. The Rust code for working with such fields must store them as an Arc in order to help properly manage the lifetime of the instance. So if the UDL interface looked like this: interface User { // Some sort of "user" object that can own todo items
}; dictionary TodoEntry { User owner; string text;
} Then the corresponding Rust code would need to look like this: struct TodoEntry { owner: std::sync::Arc<User>, text: String,
} Depending on the languge, the foreign-language bindings may also need to be aware of these embedded references. For example in Kotlin, each Object instance must be explicitly destroyed to avoid leaking the underlying memory, and this also applies to Objects stored in record fields. You can read more about managing object references in the section on interfaces .

